import logo from './logo.svg';
import './App.css';
import React from 'react'

function App() {

  function handleb1(){
    //return console.log("george")
    return console.log("wrfr");
  }

  const handleb2 = () => {
    //console.log(63);
    console.log(23);
    //return (
    //  <p> 23 </p>
    //);

  }

  const [show,setShow]=React.useState(true)

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p>
          ediiiit!
        </p>
        <ul>
          <li> <button onClick={handleb1()} className="b1">show name</button> </li>
          <li> <button onClick={handleb2()} className="b2">show age</button> </li>
          <li> <button onClick={() => {console.log("this button 3")}} className="b2">show more than once on console</button> </li>
          <li> <button onClick={()=>setShow(!show)} className="b4">show all</button> </li>
          {
          show?<b>George , 23</b>:null
          }
        </ul>

      </header>
    </div>
  );
}

export default App;
